// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

contract urun_contract {

  enum Durum {
    YerliUretim,
    OzelUretim
  }

  struct urun {
    string urun_ismi;
    uint hashed_id;
    string uretici;
    string tedarikci;
    string onayNumarasi;
    string isletmeOnayNumarasi;
    Durum durum;
  }

  urun[] public urunler;

  function urunEkle(
    string memory _urunIsmi,
    uint _hashedId,
    string memory _uretici,
    string memory _tedarikci,
    string memory _onayNumarasi,
    string memory _isletmeOnayNumarasi,
    Durum _durum
  ) external {
    urunler.push(urun({
      urun_ismi: _urunIsmi,
      hashed_id: _hashedId,
      uretici: _uretici,
      tedarikci: _tedarikci,
      onayNumarasi: _onayNumarasi,
      isletmeOnayNumarasi: _isletmeOnayNumarasi,
      durum: _durum
    }));
  }

  function urunSorgula(uint _hashedId) external view returns (
    string memory urunIsmi,
    uint hashedId,
    string memory uretici,
    string memory tedarikci,
    string memory onayNumarasi,
    string memory isletmeOnayNumarasi,
    Durum durum
  ) {
    uint index = findUrunIndex(_hashedId);
    require(index != type(uint).max, "Product not found");

    urun memory queriedUrun = urunler[index];
    return (
      queriedUrun.urun_ismi,
      queriedUrun.hashed_id,
      queriedUrun.uretici,
      queriedUrun.tedarikci,
      queriedUrun.onayNumarasi,
      queriedUrun.isletmeOnayNumarasi,
      queriedUrun.durum
    );
  }

  function urunGuncelle(
    uint _hashedId,
    string memory _urunIsmi,
    string memory _uretici,
    string memory _tedarikci,
    string memory _onayNumarasi,
    string memory _isletmeOnayNumarasi,
    Durum _durum
  ) external {
    uint index = findUrunIndex(_hashedId);
    require(index != type(uint).max, "Product not found");

    urun storage updatedUrun = urunler[index];
    updatedUrun.urun_ismi = _urunIsmi;
    updatedUrun.uretici = _uretici;
    updatedUrun.tedarikci = _tedarikci;
    updatedUrun.onayNumarasi = _onayNumarasi;
    updatedUrun.isletmeOnayNumarasi = _isletmeOnayNumarasi;
    updatedUrun.durum = _durum;
  }

  function findUrunIndex(uint _hashedId) internal view returns (uint) {
    for (uint i = 0; i < urunler.length; i++) {
      if (urunler[i].hashed_id == _hashedId) {
        return i;
      }
    }
    return type(uint).max; // If not found
  }
}

